import React from "react";
import "./css/style.css";
const Weather=()=>{
    return (
        <>
        <div className="box">
            <div className="box-info">
                <input type="search" placeholder="search.." >

                </input>
            </div>
        </div>
        </>
    )
}
export default Weather;
